 */

  margin-top: 2rem;
}

  overflow-y: auto;
  overflow-x: none;

}

  white-space: nowrap;

}

}

  background-color: #E9EAEA;
}

tr:nth-child(even),
th {
  background-color: #FFFFFF;
}

/*
 * Chart stuff
 */

svg {
  margin-top: 2rem;
  margin-bottom: 2rem;
  max-width: 100%;
}
